import React, { useState } from 'react';
import YouTube from 'react-youtube';
import Navbar from '../NavBar';
import '../css/MusicSection.css';

const MusicSection = () => {
  const songs = [
    {
      title: 'All Yours',
      artist: 'APRE',
      description: 'Our song. Do I need to say anything else?',
      youtubeUrl: 'https://www.youtube.com/watch?v=OeQz3hpgXkk'
    },
    {
      title: 'Blame Brett',
      artist: 'The Beaches',
      description: 'This song breaks me everytime I hear it.',
      youtubeUrl: 'https://www.youtube.com/watch?v=h2kUX_Fmj7k'
    },
    {
        title: 'Can I Call You Tonight?',
        artist: 'Dayglow',
        description: 'A song that always remind me of you and me in the car.',
        youtubeUrl: 'https://www.youtube.com/watch?v=hh1WeQxfCX0'
      },
      {
        title: 'Cardiac Arrest',
        artist: 'Bad Suns',
        description: '"Like cardiac arrest, high voltage when we kiss."',
        youtubeUrl: 'https://www.youtube.com/watch?v=ubqw8Bf8VX4'
      },
      {
        title: 'Salt',
        artist: 'Bad Suns',
        description: 'Another one we discovered together.',
        youtubeUrl: 'https://www.youtube.com/watch?v=uoBN56799FA'
      },
      {
        title: 'Happiness in Liquid Form',
        artist: 'Alfie Templeman',
        description: 'I know you secretly like this song.',
        youtubeUrl: 'https://www.youtube.com/watch?v=7h4_cD6A5Bs'
      },
      {
        title: 'Close To You',
        artist: 'Dayglow',
        description: '"I’m only overthinking when I’m close to you."',
        youtubeUrl: 'https://www.youtube.com/watch?v=otPB54Wxf5c'
      },
      {
        title: 'Hot Rod',
        artist: 'Dayglow',
        description: 'We used to listen to dayglow before we were together, his songs will always mean a lot',
        youtubeUrl: 'https://www.youtube.com/watch?v=tsJXoqvmgzM'
      },
      {
        title: 'Bambi',
        artist: 'Hippo Campus',
        description: 'Whenever I listen to this, I remember that time we were shooting and you making weird noises in the background',
        youtubeUrl: 'https://www.youtube.com/watch?v=ntthrYgpOKY'
      },
      {
        title: 'Alt J - Interlude II (cover)',
        artist: 'Me!',
        description: 'Had to put this in',
        youtubeUrl: 'https://www.youtube.com/watch?v=JLWPxZJ5PX0'
      },
      {
        title: 'she knows it',
        artist: 'Maggie Lindemann',
        description: 'Screaming this in the car with you >>',
        youtubeUrl: 'https://www.youtube.com/watch?v=xnbKEcMR2d8'
      },
      {
        title: 'Habit',
        artist: 'Still Woozy',
        description: '"You could be my woman right',
        youtubeUrl: 'https://www.youtube.com/watch?v=I3WakeIlDZ0'
      },
      {
        title: 'باين حبيت',
        artist: 'عمرو دياب ft. Marshmello',
        description: 'The first Arabic song that you introduced me too',
        youtubeUrl: 'https://www.youtube.com/watch?v=jNJCdxMf0t8'
      },
      {
        title: ' يا اجمل عيون',
        artist: 'عمرو دياب',
        description: 'I like the way you dance and look at me when that one lyric comes up',
        youtubeUrl: 'https://www.youtube.com/watch?v=Df45TxdJpSc'
      },
      {
        title: 'Young Dumb & Broke',
        artist: 'Khalid',
        description: 'Best concert of my life, because it was with you',
        youtubeUrl: 'https://www.youtube.com/watch?v=IPfJnp1guPc'
      },
      {
        title: 'Love Is a Bitch',
        artist: 'Two Feet',
        description: 'I love going slow with you',
        youtubeUrl: 'https://www.youtube.com/watch?v=6tnv-JDJC0Q'
      },
      {
        title: "I Feel Like I'm Drowning",
        artist: 'Two Feet',
        description: 's playlist',
        youtubeUrl: 'https://www.youtube.com/watch?v=WkVvG4QTO9M'
      },

      {
        title: 'Tell Me',
        artist: 'Joan As Police Woman',
        description: 's playlist',
        youtubeUrl: 'https://www.youtube.com/watch?v=nxPYLzu_y6U'
      },

      {
        title: 'One Time',
        artist: 'Marian Hill',
        description: 'My favourite one from the playlist',
        youtubeUrl: 'https://www.youtube.com/watch?v=upEX2JMp3c0'
      },

      {
        title: 'Take My Breath Away',
        artist: 'The Weeknd',
        description: 'You definitely take my breath away',
        youtubeUrl: 'https://www.youtube.com/watch?v=eT1E3gmST9U'
      },

      {
        title: 'Out of Time',
        artist: 'The Weeknd',
        description: 'The weird noises you make in the beginning',
        youtubeUrl: 'https://www.youtube.com/watch?v=kxgj5af8zg4'
      },
      {
        title: 'Harleys in Hawaii',
        artist: 'Katy Perry',
        description: 'You always had this playing endlessly',
        youtubeUrl: 'https://www.youtube.com/watch?v=SbbUXOZg5S4'
      },
      {
        title: ' t r a n s p a r e n t s o u l feat. Travis Barker',
        artist: 'WILLOW',
        description: 'A song I love screaming with you',
        youtubeUrl: 'https://www.youtube.com/watch?v=eG9KzyVO638'
      },
      {
        title: 'STAY',
        artist: 'The Kid LAROI, Justin Bieber ',
        description: '"I need you stay"',
        youtubeUrl: 'https://www.youtube.com/watch?v=kTJczUoc26U'
      },
      {
        title: 'Sunflower, Vol. 6',
        artist: 'Harry Styles',
        description: "'I couldnt want you any more'",
        youtubeUrl: 'https://www.youtube.com/watch?v=tUUElxEGo0U'
      },
      {
        title: 'Silence',
        artist: 'Marshmello Ft. Khalid',
        description: 'FIGHTAAA',
        youtubeUrl: 'https://www.youtube.com/watch?v=Tx1sqYc3qas'
      },
      {
        title: 'Electric Love',
        artist: 'BØRNS',
        description: 'How kissing you feels',
        youtubeUrl: 'https://www.youtube.com/watch?v=RYr96YYEaZY'
      },
      {
        title: 'Steal My Girl',
        artist: 'One Direction',
        description: '"She belongs to me"',
        youtubeUrl: 'https://www.youtube.com/watch?v=UpsKGvPjAgw'
      },
      {
        title: 'Sexy Bitch',
        artist: 'David Guetta ft Akon',
        description: 'dance dance revolution',
        youtubeUrl: 'https://www.youtube.com/watch?v=mIIN_SGQy9c'
      },
      {
        title: 'Wet Dream',
        artist: 'Wet Leg',
        description: "What makes you think you're good enough to think about me when you're touching yourself?",
        youtubeUrl: 'https://www.youtube.com/watch?v=tjpgJjdk52c'
      },
      {
        title: 'Better Off Alone',
        artist: 'Alice Deejay',
        description: '...',
        youtubeUrl: 'https://www.youtube.com/watch?v=Lgs9QUtWc3M'
      },
      {
        title: 'Something About Us',
        artist: 'Daft Punk',
        description: 'bop',
        youtubeUrl: 'https://www.youtube.com/watch?v=em0MknB6wFo'
      },
      {
        title: 'Brazil',
        artist: 'Declan McKenna',
        description: 'AUBH Winter Wonderland',
        youtubeUrl: 'https://www.youtube.com/watch?v=QHgh77iE6qc'
      },
      {
        title: 'we fell in love in october',
        artist: 'girl in red',
        description: 'we sure did',
        youtubeUrl: 'https://www.youtube.com/watch?v=iggmiF7DNoM'
      },

    // Add more songs as needed
  ];

  const [currentSongIndex, setCurrentSongIndex] = useState(0);

  const getVideoIdFromUrl = (url) => {
    const videoIdMatch = url.match(/(?:\?v=|&v=|youtu\.be\/|\/embed\/|\/v\/|\/\d{1,2}\/|\/vi\/)([^#\&\?]{11})/);
    if (videoIdMatch) {
      return videoIdMatch[1];
    }
    return null;
  };

  const handleNextSong = () => {
    // setCurrentSongIndex((prevIndex) => (prevIndex + 1) % songs.length);
    const randomIndex = Math.floor(Math.random() * songs.length);
    // const randomSong = songs[randomIndex];
    setCurrentSongIndex(randomIndex);
  };

  const currentSong = songs[currentSongIndex];
  const videoId = currentSong?.youtubeUrl ? getVideoIdFromUrl(currentSong.youtubeUrl) : null;

  return (
    <section id="music-section">
      <h2>Music Section</h2>
      <div className="song">
        <h3>{currentSong.title}</h3>
        <p>Artist: {currentSong.artist}</p>
        <p>Description: {currentSong.description}</p>
        {videoId && <YouTube videoId={videoId} />}
      </div>
      <button onClick={handleNextSong}>Shuffle!</button>
    </section>
  );
};

export default MusicSection;
